package com.founder.leecode.leecode.$202210.$20220915;

import java.util.HashMap;
import java.util.Map;

public class $4isAnagram {
    public static boolean isAnagram(String s, String t) {
        int lengths = s.length();
        int lengtht = t.length();
        if(lengths!=lengtht){
            return false;
        }
        Map<Character,Integer> maps = new HashMap<>();
        Map<Character,Integer> mapt = new HashMap<>();
        for (int i = 0; i < s.length(); i++) {
            maps.put(s.charAt(i),maps.getOrDefault(s.charAt(i),0)+1);
        }
        for (int i = 0; i < t.length(); i++) {
            mapt.put(t.charAt(i),mapt.getOrDefault(t.charAt(i),0)+1);
        }
        if(maps.size()!=mapt.size()){
            return false;
        }
        for (Character character : maps.keySet()) {
            int sCount = maps.getOrDefault(character,0).intValue();
            int tCount = mapt.getOrDefault(character,0).intValue();
            if(sCount!=tCount){
             return false;
            }
        }
        return true;
    }




    public static void main(String[] args) {
       // String s =  "";
        //String t = "";
        String s =   "rat";
        String t = "car";
        System.out.println(isAnagram(s,t));
    }
}
